description:
Lola's sister asks her to take a test for her. Mr. Everhard cant believe that she got all the answers right, but Lola still thinks she can learn a few things about life
Dane is patiently waiting for Skylar to show up for her study session. When she arrives very late Dane decides to teach her a thing or two about manners
One of Aaliyah's friends set up a joke on her and Mr. Tate (Manuel Ferrara) saying that she needs help with Sex-Ed. The only thing her friends didnt know is that the joke would be on them
Sara and Johnny have a secret affair going on. Johnny doesn't want to disappoint the school or other teachers if they find out: but Sara on the other hand just wants to fuck in every room in the school 

Sara Luv,Lola Foxx,Aaliyah Love,Skylar Green,Manuel Ferrara,Erik Everhard,Johnny Castle,Dane Cross

